import{_ as e,o,c as a,O as l}from"./chunks/framework.9a1c14ea.js";const p=JSON.parse('{"title":"Options","description":"","frontmatter":{},"headers":[],"relativePath":"k6-tests/src/values/env.md","filePath":"packages/k6-tests/src/values/env.md","lastUpdated":1751469544000}'),d={name:"k6-tests/src/values/env.md"},t=l('<h1 id="options" tabindex="-1">Options <a class="header-anchor" href="#options" aria-label="Permalink to &quot;Options&quot;">​</a></h1><p>all cdPerf tests share a set of options, what these are and what they do is listed below</p><h2 id="env-admin-login" tabindex="-1">ENV <code>ADMIN_LOGIN</code> <a class="header-anchor" href="#env-admin-login" aria-label="Permalink to &quot;ENV `ADMIN_LOGIN`&quot;">​</a></h2><p>the login name of an administrative user</p><ul><li>default value: <code>admin</code></li><li><code>export ADMIN_LOGIN=main</code></li></ul><h2 id="env-admin-password" tabindex="-1">ENV <code>ADMIN_PASSWORD</code> <a class="header-anchor" href="#env-admin-password" aria-label="Permalink to &quot;ENV `ADMIN_PASSWORD`&quot;">​</a></h2><p>the login password of that administrative user</p><ul><li>default value: <code>admin</code></li><li><code>export ADMIN_PASSWORD=secret</code></li></ul><h2 id="env-sleep-after-request" tabindex="-1">ENV <code>SLEEP_AFTER_REQUEST</code> <a class="header-anchor" href="#env-sleep-after-request" aria-label="Permalink to &quot;ENV `SLEEP_AFTER_REQUEST`&quot;">​</a></h2><p>most tests can pause after a request was made, this option defines the duration</p><ul><li>default value: <code>0.2</code></li><li><code>export SLEEP_AFTER_REQUEST=1</code></li></ul><h2 id="env-sleep-after-iteration" tabindex="-1">ENV <code>SLEEP_AFTER_ITERATION</code> <a class="header-anchor" href="#env-sleep-after-iteration" aria-label="Permalink to &quot;ENV `SLEEP_AFTER_ITERATION`&quot;">​</a></h2><p>most tests can pause after the iteration has finished, this option defines the duration</p><ul><li>default value: <code>0</code></li><li><code>export SLEEP_AFTER_ITERATION=1</code></li></ul><h2 id="env-seed-container-name" tabindex="-1">ENV <code>SEED_CONTAINER_NAME</code> <a class="header-anchor" href="#env-seed-container-name" aria-label="Permalink to &quot;ENV `SEED_CONTAINER_NAME`&quot;">​</a></h2><p>name of the container that stores the test dummy data. This is used for the seed data scripts to hydrate the platform with data.</p><ul><li>default value: <code>cdperf</code></li><li><code>export SEED_CONTAINER_NAME=anyName</code></li></ul><h2 id="env-seed-container-type" tabindex="-1">ENV <code>SEED_CONTAINER_TYPE</code> <a class="header-anchor" href="#env-seed-container-type" aria-label="Permalink to &quot;ENV `SEED_CONTAINER_TYPE`&quot;">​</a></h2><p>not every platform supports every container type. This option can be used to decide which type of container is used</p><ul><li>default value for openCloud: <code>space</code></li><li>default value for ownCloudServer and nextcloud: <code>directory</code></li><li><code>export SEED_CONTAINER_TYPE=space</code></li><li><code>export SEED_CONTAINER_TYPE=directory</code></li></ul><h2 id="env-seed-users-create" tabindex="-1">ENV <code>SEED_USERS_CREATE</code> <a class="header-anchor" href="#env-seed-users-create" aria-label="Permalink to &quot;ENV `SEED_USERS_CREATE`&quot;">​</a></h2><p>specifies whether the seed test should create the users or not</p><ul><li>default value: <code>true</code></li><li><code>export SEED_USERS_CREATE=false</code></li></ul><h2 id="env-seed-users-delete" tabindex="-1">ENV <code>SEED_USERS_DELETE</code> <a class="header-anchor" href="#env-seed-users-delete" aria-label="Permalink to &quot;ENV `SEED_USERS_DELETE`&quot;">​</a></h2><p>specifies whether the seed test should delete the users or not</p><ul><li>default value: <code>true</code></li><li><code>export SEED_USERS_DELETE=false</code></li></ul><h2 id="env-seed-users-total" tabindex="-1">ENV <code>SEED_USERS_TOTAL</code> <a class="header-anchor" href="#env-seed-users-total" aria-label="Permalink to &quot;ENV `SEED_USERS_TOTAL`&quot;">​</a></h2><p>specifies how many users should be created or deleted</p><ul><li>default value: <code>25</code></li><li><code>export SEED_USERS_TOTAL=50</code></li></ul><h2 id="env-seed-groups-create" tabindex="-1">ENV <code>SEED_GROUPS_CREATE</code> <a class="header-anchor" href="#env-seed-groups-create" aria-label="Permalink to &quot;ENV `SEED_GROUPS_CREATE`&quot;">​</a></h2><p>specifies whether the seed test should create the groups or not</p><ul><li>default value: <code>true</code></li><li><code>export SEED_GROUPS_CREATE=false</code></li></ul><h2 id="env-seed-groups-delete" tabindex="-1">ENV <code>SEED_GROUPS_DELETE</code> <a class="header-anchor" href="#env-seed-groups-delete" aria-label="Permalink to &quot;ENV `SEED_GROUPS_DELETE`&quot;">​</a></h2><p>specifies whether the seed test should delete the groups or not</p><ul><li>default value: <code>true</code></li><li><code>export SEED_GROUPS_DELETE=false</code></li></ul><h2 id="env-seed-groups-total" tabindex="-1">ENV <code>SEED_GROUPS_TOTAL</code> <a class="header-anchor" href="#env-seed-groups-total" aria-label="Permalink to &quot;ENV `SEED_GROUPS_TOTAL`&quot;">​</a></h2><p>specifies how many groups should be created or deleted</p><ul><li>default value: <code>1</code></li><li><code>export SEED_GROUPS_TOTAL=2</code></li></ul><h2 id="env-data-calendar-root" tabindex="-1">ENV <code>DATA_CALENDAR_ROOT</code> <a class="header-anchor" href="#env-data-calendar-root" aria-label="Permalink to &quot;ENV `DATA_CALENDAR_ROOT`&quot;">​</a></h2><p>specifies the root of the calendar tree structure. Will be placed inside <code>SEED_CONTAINER_TYPE</code></p><ul><li>default value: <code>calendar</code></li><li><code>export DATA_CALENDAR_ROOT=dummy_calendar</code></li></ul><h2 id="env-data-calendar-from-year" tabindex="-1">ENV <code>DATA_CALENDAR_FROM_YEAR</code> <a class="header-anchor" href="#env-data-calendar-from-year" aria-label="Permalink to &quot;ENV `DATA_CALENDAR_FROM_YEAR`&quot;">​</a></h2><p>specifies in which year the calendar should start</p><ul><li>default value: <code>2023</code></li><li><code>export DATA_CALENDAR_FROM_YEAR=2000</code></li></ul><h2 id="env-data-calendar-to-year" tabindex="-1">ENV <code>DATA_CALENDAR_TO_YEAR</code> <a class="header-anchor" href="#env-data-calendar-to-year" aria-label="Permalink to &quot;ENV `DATA_CALENDAR_TO_YEAR`&quot;">​</a></h2><p>specifies in which year the calendar should end</p><ul><li>default value: <code>2023</code></li><li><code>export DATA_CALENDAR_FROM_YEAR=2002</code></li></ul><h2 id="env-seed-resource-root" tabindex="-1">ENV <code>SEED_RESOURCE_ROOT</code> <a class="header-anchor" href="#env-seed-resource-root" aria-label="Permalink to &quot;ENV `SEED_RESOURCE_ROOT`&quot;">​</a></h2><p>specifies the name of the folder in which the test resources are located</p><ul><li>default value: <code>resource</code></li><li><code>export SEED_RESOURCE_ROOT=dummy_resources</code></li></ul><h2 id="env-seed-resource-small-name" tabindex="-1">ENV <code>SEED_RESOURCE_SMALL_NAME</code> <a class="header-anchor" href="#env-seed-resource-small-name" aria-label="Permalink to &quot;ENV `SEED_RESOURCE_SMALL_NAME`&quot;">​</a></h2><p>specifies how small resource should be called</p><ul><li>default value: <code>small.zip</code></li><li><code>export SEED_RESOURCE_SMALL_NAME=s.zip</code></li></ul><h2 id="env-seed-resource-small-size" tabindex="-1">ENV <code>SEED_RESOURCE_SMALL_SIZE</code> <a class="header-anchor" href="#env-seed-resource-small-size" aria-label="Permalink to &quot;ENV `SEED_RESOURCE_SMALL_SIZE`&quot;">​</a></h2><p>this allows you to set the file size of the small resource in mb</p><ul><li>default value: <code>1</code></li><li><code>export SEED_RESOURCE_SMALL_SIZE=2</code></li></ul><h2 id="env-seed-resource-medium-name" tabindex="-1">ENV <code>SEED_RESOURCE_MEDIUM_NAME</code> <a class="header-anchor" href="#env-seed-resource-medium-name" aria-label="Permalink to &quot;ENV `SEED_RESOURCE_MEDIUM_NAME`&quot;">​</a></h2><p>specifies how small resource should be called</p><ul><li>default value: <code>medium.zip</code></li><li><code>export SEED_RESOURCE_MEDIUM_NAME=m.zip</code></li></ul><h2 id="env-seed-resource-medium-size" tabindex="-1">ENV <code>SEED_RESOURCE_MEDIUM_SIZE</code> <a class="header-anchor" href="#env-seed-resource-medium-size" aria-label="Permalink to &quot;ENV `SEED_RESOURCE_MEDIUM_SIZE`&quot;">​</a></h2><p>this allows you to set the file size of the medium resource in mb</p><ul><li>default value: <code>20</code></li><li><code>export SEED_RESOURCE_MEDIUM_SIZE=40</code></li></ul><h2 id="env-seed-resource-large-name" tabindex="-1">ENV <code>SEED_RESOURCE_LARGE_NAME</code> <a class="header-anchor" href="#env-seed-resource-large-name" aria-label="Permalink to &quot;ENV `SEED_RESOURCE_LARGE_NAME`&quot;">​</a></h2><p>specifies how small resource should be called</p><ul><li>default value: <code>large.zip</code></li><li><code>export SEED_RESOURCE_LARGE_NAME=l.zip</code></li></ul><h2 id="env-seed-resource-large-size" tabindex="-1">ENV <code>SEED_RESOURCE_LARGE_SIZE</code> <a class="header-anchor" href="#env-seed-resource-large-size" aria-label="Permalink to &quot;ENV `SEED_RESOURCE_LARGE_SIZE`&quot;">​</a></h2><p>this allows you to set the file size of the small resource in mb</p><ul><li>default value: <code>100</code></li><li><code>export SEED_RESOURCE_LARGE_SIZE=200</code></li></ul><h2 id="env-pool-users" tabindex="-1">ENV <code>POOL_USERS</code> <a class="header-anchor" href="#env-pool-users" aria-label="Permalink to &quot;ENV `POOL_USERS`&quot;">​</a></h2><p>defines the path to the json files that contain the user information</p><ul><li>default value: <code>Embedded</code></li><li><code>export POOL_USERS=$HOME/test/pools/users.json</code></li></ul><h2 id="env-pool-groups" tabindex="-1">ENV <code>POOL_GROUPS</code> <a class="header-anchor" href="#env-pool-groups" aria-label="Permalink to &quot;ENV `POOL_GROUPS`&quot;">​</a></h2><p>defines the path to the json files that contain the group information</p><ul><li>default value: <code>Embedded</code></li><li><code>export POOL_GROUPS=$HOME/test/pools/groups.json</code></li></ul><h2 id="env-platform-type" tabindex="-1">ENV <code>PLATFORM_TYPE</code> <a class="header-anchor" href="#env-platform-type" aria-label="Permalink to &quot;ENV `PLATFORM_TYPE`&quot;">​</a></h2><p>specifies which client platform should be used</p><ul><li>default value: <code>openCloud</code></li><li><code>export PLATFORM_TYPE=openCloud</code></li><li><code>export PLATFORM_TYPE=ownCloudServer</code></li><li><code>export PLATFORM_TYPE=nextcloud</code></li></ul><h2 id="env-platform-base-url" tabindex="-1">ENV <code>PLATFORM_BASE_URL</code> <a class="header-anchor" href="#env-platform-base-url" aria-label="Permalink to &quot;ENV `PLATFORM_BASE_URL`&quot;">​</a></h2><p>the url under which the respective platform can be reached.</p><ul><li>default value: <code>https://localhost:9200</code></li><li><code>export PLATFORM_BASE_URL=https://cloud-domain.org</code></li></ul><h2 id="env-auth-n-provider-type" tabindex="-1">ENV <code>AUTH_N_PROVIDER_TYPE</code> <a class="header-anchor" href="#env-auth-n-provider-type" aria-label="Permalink to &quot;ENV `AUTH_N_PROVIDER_TYPE`&quot;">​</a></h2><p>defines which idp should be used</p><ul><li>default value: <code>kopano</code></li><li><code>export AUTH_N_PROVIDER=keycloak</code></li><li><code>export AUTH_N_PROVIDER=kopano</code></li><li><code>export AUTH_N_PROVIDER=basicAuth</code></li></ul><h2 id="env-auth-n-provider-kopano-base-url" tabindex="-1">ENV <code>AUTH_N_PROVIDER_KOPANO_BASE_URL</code> <a class="header-anchor" href="#env-auth-n-provider-kopano-base-url" aria-label="Permalink to &quot;ENV `AUTH_N_PROVIDER_KOPANO_BASE_URL`&quot;">​</a></h2><p>indicates under which url kopano can be reached, only necessary if <code>AUTH_N_PROVIDER_TYPE</code> is set to <code>kopano</code></p><ul><li>default value: <code>https://localhost:9200</code></li><li><code>export AUTH_N_PROVIDER_KOPANO_BASE_URL=https://kopano.cloud-domain.org/auth/</code></li></ul><h2 id="env-auth-n-provider-kopano-redirect-url" tabindex="-1">ENV <code>AUTH_N_PROVIDER_KOPANO_REDIRECT_URL</code> <a class="header-anchor" href="#env-auth-n-provider-kopano-redirect-url" aria-label="Permalink to &quot;ENV `AUTH_N_PROVIDER_KOPANO_REDIRECT_URL`&quot;">​</a></h2><p>specifies the redirect url, only necessary if <code>AUTH_N_PROVIDER_TYPE</code> is set to <code>kopano</code></p><ul><li>default value: <code>https://localhost:9200/oidc-callback.html</code></li><li><code>export AUTH_N_PROVIDER_KOPANO_BASE_URL=https://cloud-domain.org/oidc-callback.html</code></li></ul><h2 id="env-auth-n-provider-kopano-client-id" tabindex="-1">ENV <code>AUTH_N_PROVIDER_KOPANO_CLIENT_ID</code> <a class="header-anchor" href="#env-auth-n-provider-kopano-client-id" aria-label="Permalink to &quot;ENV `AUTH_N_PROVIDER_KOPANO_CLIENT_ID`&quot;">​</a></h2><p>specifies client id to use, only necessary if <code>AUTH_N_PROVIDER_TYPE</code> is set to <code>kopano</code></p><ul><li>default value: <code>web</code></li><li><code>export AUTH_N_PROVIDER_KOPANO_CLIENT_ID=other-client-id</code></li></ul><h2 id="env-auth-n-provider-keycloak-realm" tabindex="-1">ENV <code>AUTH_N_PROVIDER_KEYCLOAK_REALM</code> <a class="header-anchor" href="#env-auth-n-provider-keycloak-realm" aria-label="Permalink to &quot;ENV `AUTH_N_PROVIDER_KEYCLOAK_REALM`&quot;">​</a></h2><p>defines the keycloak realm, only necessary if <code>AUTH_N_PROVIDER_TYPE</code> is set to <code>keycloak</code></p><ul><li><code>export AUTH_N_PROVIDER_KEYCLOAK_REALM=opencloud</code></li></ul><h2 id="env-auth-n-provider-keycloak-base-url" tabindex="-1">ENV <code>AUTH_N_PROVIDER_KEYCLOAK_BASE_URL</code> <a class="header-anchor" href="#env-auth-n-provider-keycloak-base-url" aria-label="Permalink to &quot;ENV `AUTH_N_PROVIDER_KEYCLOAK_BASE_URL`&quot;">​</a></h2><p>indicates under which url keycloak can be reached, only necessary if <code>AUTH_N_PROVIDER_TYPE</code> is set to <code>keycloak</code></p><ul><li><code>export AUTH_N_PROVIDER_KEYCLOAK_BASE_URL=https://keycloak.cloud-domain.org/auth/</code></li></ul><h2 id="env-auth-n-provider-keycloak-redirect-url" tabindex="-1">ENV <code>AUTH_N_PROVIDER_KEYCLOAK_REDIRECT_URL</code> <a class="header-anchor" href="#env-auth-n-provider-keycloak-redirect-url" aria-label="Permalink to &quot;ENV `AUTH_N_PROVIDER_KEYCLOAK_REDIRECT_URL`&quot;">​</a></h2><p>specifies the redirect url, only necessary if <code>AUTH_N_PROVIDER_TYPE</code> is set to <code>keycloak</code></p><ul><li><code>export AUTH_N_PROVIDER_KEYCLOAK_REDIRECT_URL=https://cloud-domain.org/oidc-callback.html</code></li></ul><h2 id="env-auth-n-provider-keycloak-social-provider-realm" tabindex="-1">ENV <code>AUTH_N_PROVIDER_KEYCLOAK_SOCIAL_PROVIDER_REALM</code> <a class="header-anchor" href="#env-auth-n-provider-keycloak-social-provider-realm" aria-label="Permalink to &quot;ENV `AUTH_N_PROVIDER_KEYCLOAK_SOCIAL_PROVIDER_REALM`&quot;">​</a></h2><p>specifies the social auth realm, only necessary if <code>AUTH_N_PROVIDER_TYPE</code> is set to <code>keycloak</code></p><ul><li><code>export AUTH_N_PROVIDER_KEYCLOAK_SOCIAL_PROVIDER_REALM=social-realm</code></li></ul><h2 id="env-auth-n-provider-keycloak-client-id" tabindex="-1">ENV <code>AUTH_N_PROVIDER_KEYCLOAK_CLIENT_ID</code> <a class="header-anchor" href="#env-auth-n-provider-keycloak-client-id" aria-label="Permalink to &quot;ENV `AUTH_N_PROVIDER_KEYCLOAK_CLIENT_ID`&quot;">​</a></h2><p>specifies client id to use, only necessary if <code>AUTH_N_PROVIDER_TYPE</code> is set to <code>keycloak</code></p><ul><li>default value: <code>web</code></li><li><code>export AUTH_N_PROVIDER_KEYCLOAK_CLIENT_ID=other-client-id</code></li></ul>',107),i=[t];function r(c,E,s,n,u,_){return o(),a("div",null,i)}const R=e(d,[["render",r]]);export{p as __pageData,R as default};
